import React from 'react';
import Home from './pages/Home';
import Button from '@mui/material/Button';

function App() {

  const appStyle = {
    background: "linear-gradient(to bottom, #282c34 30%, #0398fc 150%)",
    height: '100vh',
    width: '100vw',
    overflow: 'auto'
  };

  const navStyle = {
    color: 'white',
    padding: '10px 20px',
    display: 'flex',
    justifyContent: 'space-around',
    position: 'fixed',
    top: 0,
    width: '100%',
    zIndex: 1000
  };

  const navItemStyle = {
    color: 'black',
    textDecoration: 'none', /* Removes underline from links */
    padding: '5px', /* Adds space around each link */
    fontSize: '16px',
    backgroundColor: 'transparent' /* Initial background color */
  };

  return (
    <>
    <div style={appStyle}>

      <nav style={navStyle}>
        <a href="#home" style={navItemStyle}>
          <Button variant="contained">Home</Button>
        </a>
        <a href="#test" style={navItemStyle}>
          <Button variant="contained">Test</Button>
        </a>
        <a href="https://www.overleaf.com/read/xyvycpwfxnxj" target="_blank" rel="noopener noreferrer" style={navItemStyle}>
          <Button variant="contained">Resume</Button>
        </a>
      </nav>

      <Home />
    </div>
    </>
  );
}

export default App;
